import { Link } from "react-router-dom";
import React, { useState } from "react";
import 'bootstrap/dist/js/bootstrap.bundle.min'; // for toggle functionality
import './App.css'; // Custom CSS for styling sidebar (provided below)

function Navbar() {
  const [isMousedOver, setMouseOver] = useState(false);

  function handleMouseOver() {
    setMouseOver(true);
  }
  function handleMouseOut() {
    setMouseOver(false);
  }
 
  return (
    <div className="header">
      {/* ✅ Horizontal Navbar - Visible on small to large screens (<1200px) */}
      <nav className="navbar navbar-expand-lg navbar-dark bg-dark d-xl-none">
        <div className="container-fluid">
          <Link className="navbar-brand" to="/">Ashish's Portfolio</Link>
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#topNavbar">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="topNavbar">
            <ul className="navbar-nav ms-auto mb-2 mb-lg-0">
              <li className="nav-item"><Link className="nav-link" to="/">Home</Link></li>
              <li className="nav-item"><Link className="nav-link" to="/about">About</Link></li>
              <li className="nav-item"><Link className="nav-link" to="/projects">Projects</Link></li>
              <li className="nav-item"><Link className="nav-link" to="/contact">Contact</Link></li>
            </ul>
          </div>
        </div>
      </nav>

      {/* ✅ Vertical Sidebar - Visible on extra large screens (≥1200px) */}
      <div className="d-none d-xl-block">
        <div className="sidebar text-white p-4">
          <h4 className="text-center">Aashish</h4>
          <div class="social-links text-center">
            <a href="https://x.com/AshishT61164097?t=inA1_MQnI2HOqX7ijVt6vg&s=09" class="twitter"><i class="bi bi-twitter-x"></i></a>
            <a href="#" class="facebook"><i class="bi bi-facebook"></i></a>
            <a href="https://www.instagram.com/aashish._.tiwari?igsh=ZjR6c3lvcW1xejl2" class="instagram"><i class="bi bi-instagram"></i></a>
            <a href="https://www.linkedin.com/in/aashish-tiwari-6a539b336?utm_source=share&utm_campaign=share_via&utm_content=profile&utm_medium=android_app" class="linkedin"><i class="bi bi-linkedin"></i></a>
          </div>
          <ul className="nav flex-column mt-4">
            <li className="nav-item" style={{ backgroundColor: isMousedOver ? "black" : "white" }}
            onMouseOver={handleMouseOver}
            onMouseOut={handleMouseOut}><Link className="nav-link" to="/"><i class="bi bi-house navicon"></i>Home</Link></li>
            <li className="nav-item"><Link className="nav-link" to="/about"><i class="bi bi-person navicon"></i>About</Link></li>
            <li className="nav-item"><Link className="nav-link" to="/projects"><i class="bi bi-file-earmark-text navicon"></i>Projects</Link></li>
            <li className="nav-item"><Link className="nav-link" to="/contact"><i class="bi bi-envelope navicon"></i>Contact</Link></li>
          </ul>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
